import React from "react"
import '../../index.css'

import { trackPromise } from 'react-promise-tracker';

class TeamGameStat extends React.Component {


    constructor(props) {
        super()
        this.state = {
            teamStat: [],
            standings: []
        }
    }

    async componentDidMount() {
        this.setState({
            teamStat: this.props.stat
        });
        this.setState({
            standings: this.props.stat.standings
        })
    }

    render() {
        let wins = this.state.standings.wins
        let losses = this.state.standings.losses
        let otlosses = this.state.standings.overtimeLosses

        return (
            <p className="teamScore">{wins}-{losses}-{otlosses}</p>
        )
      }



}
